import React from 'react'
import './cardOne.scss'
import {Col, Container, Row} from "react-bootstrap";
import Link from "next/link";

const CardOne = () => {
  return (
      <div class="cardOne">
          <Container>
              <Row>
                  <Col sm={12} md={4}>1</Col>
                  <Col sm={12} md={4}>2</Col>
                  <Col sm={12} md={4}>3</Col>
                  <Col sm={12} md={4}>4</Col>
              </Row>
          </Container>
      </div>
  )
}

export default CardOne
